import React from 'react';
import '../../App.css';

export default function Commencer() {
  return (
    <>
      <h1 className='home'>EPIC</h1>
      <div className="commencer">
        <h1>Apprendre en<br></br>s'amusant</h1><br></br>
        <i class="fas fa-book-reader"></i>
       
        </div>
    </>
  );
}
